import React from "react";
import "./Weather.css";

export default function Weather() {
  return (
    <div className="Weather">
      <ul>
        <li>Wednesday 07:00</li>
        <li>Mostly Cloudy</li>
      </ul>
      <div className="row">
        <img src=""></img>
      </div>
    </div>
  );
}
